import React from 'react';
import './SearchPage.css';

const SearchPage = () => {
  return (
    <div className='search_page'>
      <p>HOTPLACE</p>
      <ul>
        <li>지역검색</li>
        <div className='search_box'>
          <input
            type='search'
            className='search_input'
            placeholder='Search...'
          />
        </div>
      </ul>
    </div>
  );
};

export default SearchPage;
